import React, { useState } from 'react';

const App = () => {
    let [todo, setTodo] = useState("");

    const display = (event) => {
        setTodo(event.target.value);
    }

    return(
        <>
            <div className='main_div'>
                <div className='center_div'>
                    <br/>
                    <h1> ToDo List</h1>
                    <br/>
                    <input type='text' placeholder='Add a Item' onChange={display} />
                    <button> + </button>
                    <ol>
                        <li>{todo}</li>
                    </ol>
                </div>
            </div>
        </>
    );
}

export default App;
